import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
    return (
      <div>
          <Link to={'/'}>
                <Button>Home</Button>
              </Link>
        <header>
          <p>Nav</p>
        </header>
      </div>
    );
  }

  export default Nav;
